import { useState } from "react";
import { useEffect } from 'react';

function ExchangeComponent() {
    const [accounts, setAccounts] = useState([]);

    useEffect(() => {
        fetch("/a-service/v1/accounts/getAllAccount/1")
            .then(res => res.json())
            .then(
                (result) => {
                    setAccounts(result)
                },
                (error) => {
                    console.log(error)
                }
            )
    }, [])
    return (
        <div className="container">
            <form>
                    <h1 className='text-center'>Login</h1>
                    <div className='form-group'>
                        <label>Sold Account Type</label>
                        <input className='form-control' name="soldAccountType" onChange={this.onChange}/>
                    </div>
                    <div className='form-group'>
                        <label>Received Account Type</label>
                        <input className='form-control' name="receivedAccountType" onChange={this.onChange}/>
                    </div>
                    <div className='form-group'>
                        <label>Sold Amount</label>
                        <input className='form-control' name="soldAmount" onChange={this.onChange}/>
                    </div>
                    <div className='form-group'>
                        <label>Exchange Rate</label>
                        <input className='form-control' name="exchangeRate" onChange={this.onChange}/>
                    </div>
                    <button className='btn btn-primary' onClick={this.onClickLogin}>Login</button>

                </form>
        </div>
    );
}
export default ExchangeComponent;
